  "call_control.inbound_routes.did_option_detail": "Spezifizieren Sie das übereinzustimmende Muster des DID und leiten Sie den eingehenden Anruf durch diese eingehende Leitung. Die Optionen sind:<br />·Muster DID: Fügen Sie ein oder mehrere Muster des DID hinzu. Die Anrufe, die dem definierten DID entsprechen, werden zum definierten Ziel weitergeleitet. Tragen Sie nichts ein, um eingehende Anrufe mit einem beliebigen oder keinen DID übereinzustimmen.<br />·Muster DID mit Nebenstellen übereinstimmen: Verwenden Sie die Wildcard {{.Ext}} für die Übereinstimmung der Nebenstellennummer im Muster des DID. Wenn Sie diesen Vorgang auswählen, müssen Sie das Ziel für diese eingehende Leitung als <b>Ausgewählte Nebenstellen übereinstimmen</b> konfigurieren und die für die Übereinstimmung zulässigen Nebenstellen auswählen. Wenn z. B. das Muster des DID 550{{.Ext}} und die erlaubte Nebenstelle 1000 ist, dann werden Anrufe von DID 5501000 an die Nebenstelle 1000 geleitet und Anrufe von 5502000 stimmen mit dieser Regel nicht überein.<br />·DID-Bereich mit Nebenstellenbereich übereinstimmen: Übereinstimmung des DID-Bereichs und des Nebenstellenbereichs mit One-to-One-Korrespondenz.  Wenn Sie diese Option auswählen, müssen Sie das Ziel für diese eingehende Leitung konfigurieren als <b>DID-Bereich mit Nebenstellenbereich übereinstimmen</b> und den DID- und Nebenstellenbereich einrichten. Wenn z. B. der DID-Bereich 5503301-5503305 und der Nebenstellenbereich 1001-1005 ist, werden Anrufe von DID 5503301 zu 1001 geleitet und Anrufe von 5503302 zu 1002.<br /><br />In den Mustern für DID haben die folgenden Zeichen besondere Bedeutung:<br /> X entspricht den Zahlen 0-9;<br /> Z entspricht den Zahlen 1-9;<br /> N entspricht den Zahlen 2-9;<br /> [12345-9] entspricht den Zahlen in der Klammer (in diesem Beispiel 1, 2, 3, 4, 5, 6, 7, 8, 9);<br /> Wildcard „.“ entspricht einer oder mehreren Zahlen. Z. B. „9011.“ entspricht allen, die mit 9011 beginnen (ausgenommen 9011 selbst);<br /> Wildcard „!“ entspricht keiner oder mehr als einer Zahl. Z. B. „9011.“ entspricht allen, die mit 9011 beginnen (einschließlich 9011 selbst);",
