  "call_control.office_time_and_holidays.type_detail": "Definieren Sie die Art des Feiertags. Die Optionen sind:<br />·Nach Datum: Wählen Sie ein bestimmtes Datum aus und der Feiertag wird nur einmalig angewendet.<br />·Nach Monat: Wählen Sie einen bestimmten Monat + Tag aus und der Feiertag wird jedes Jahr angewendet.<br />·Nach Woche: Wählen Sie einen bestimmten Monat + einen bestimmten Tag einer bestimmten Woche aus und der Feiertag wird jedes Jahr angewendet.<br />Hinweis: Wenn Sie Nach Datum und Nach Monat auswählen, können das Startdatum und das Enddatum am selben Tag sein und dadurch einen bestimmten Tag anzeigen.",
