  "call_control.outbound_routes.available_time": " Verfügbare Zeit",
  "call_control.outbound_routes.available_time_detail": "Wählen Sie die Zeitbedingung für die Zulassung dieser ausgehenden Leitung aus. Die Optionen sind:<br />·Immer: Zugelassene Nebenstellen können jederzeit ausgehende Anrufe über diese ausgehende Leitung tätigen.<br />·Basierend auf globalen Geschäftszeiten: Steuern Sie die Leitung basierend auf den Geschäftszeiten und Feiertagen, die unter <b>Anrufsteuerung > Geschäftszeiten und Feiertage</b> definiert sind. Sie können einzeln definieren, ob diese Leitung während der Geschäftszeiten, außerhalb der Geschäftszeiten und an Feiertagen zugelassen ist. <br /> Basierend auf benutzerdefinierten Geschäftszeiten: Definieren Sie eine exklusive Regel für Geschäftszeiten für diese Leitung und steuern Sie sie entsprechend. Sie können einzeln bestimmen, ob diese Leitung während der Geschäftszeiten, außerhalb der Geschäftszeiten und an Feiertagen zulässig ist.<br /> Basierend auf benutzerdefinierten Zeiträumen: Definieren Sie mehre Zeiträume, während derer diese Leitung erlaubt ist. Sie können auch definieren, ob diese Leitung während der Feiertage zugelassen ist.",
