  "call_control.outbound_routes.dial_patterns": "Übereinstimmung des Wählmusters",
  "call_control.outbound_routes.dial_patterns_detail": "Ausgehende Anrufe, die diesem Wählmuster entsprechen, werden diese ausgehende Leitung verwenden. <br /><br />Bei Mustern haben die folgenden Zeichen besondere Bedeutung:<br />·X entspricht den Zahlen 0-9;<br />·Z entspricht den Zahlen 1-9;<br />·N entspricht den Zahlen 2-9;<br /> [12345-9] entspricht den Zahlen in der Klammer (in diesem Beispiel 1, 2, 3, 4, 5, 6, 7, 8, 9);<br /> Wildcard „.“ entspricht einer oder mehreren Zahlen. Z. B. „9011.“ entspricht allen, die mit 9011 beginnen (ausgenommen 9011 selbst);<br /> Wildcard „!“ für SIP-Nebenstellen entspricht keinem oder mehreren Zeichen. Z. B. „9011.“ entspricht allen SIP-Nebenstellen, die mit 9011 beginnen (einschließlich 9011 selbst); bei FXS-Nebenstellen wird sie für Overlap-Dialing verwendet. Die Telefonanlage wählt, sobald die Nummer vollständig ist und sobald eine eindeutige Übereinstimmung vorliegt. Beispielsweise wählt die Telefonanlage bei „9011!“ sofort, wenn FXS-Nebenstellen 9011 wählen.<br /><br />Entfernen: Entfernen erlaubt Ihnen die Anzahl der Stellen zu spezifizieren, die am Anfang der Telefonnummer entfernt werden, bevor der Anruf hergestellt wird. Wenn Sie beispielsweise 0 drücken müssen, bevor Sie eine Telefonnummer wählen, muss eine Zahl von der gewählten Abfolge entfernt werden, bevor der Anruf hergestellt wird.<br /><br />Voranstellen: Diese Zahlen werden der Telefonnummer vorangestellt, bevor der Anruf hergestellt wird. Wenn beispielsweise ein Trunk eine 10-stellige Nummer erfordert, aber Teilnehmer eine 7-stellige Nummer vorziehen, kann dieses Feld dazu verwendet werden, allen 7-stelligen Telefonnummern eine 3-stellige Vorwahl voranzustellen, bevor Anrufe hergestellt werden. ",
