  "call_features.ivr.allow_out_record8": "Wählen Sie 8",
  "call_features.ivr.allow_out_record9": "Wählen Sie 9",
  "call_features.ivr.allow_out_record_detail": "Wenn aktiviert, werden die Anrufe, die dieses Ziel erreichen, nicht aufgezeichnet, ganz gleich, ob für das Ziel die Anrufaufzeichnung aktiviert ist oder nicht. Diese Funktion ist standardmäßig deaktiviert.\n\nHinweis: Es wird empfohlen, diese Funktion mit der richtigen IVR-Ansage zu verwenden, damit Anrufer richtig informiert werden.",
  "call_features.ivr.allow_out_record_star": "Wählen Sie *",
  "call_features.ivr.dial_by_name": "Wählen nach Name",
  "call_features.ivr.dial_ext_list": "Nebenstellen anwählen",
  "call_features.ivr.dial_ext_option": "Nebenstellen anwählen",
  "call_features.ivr.dial_ext_option_detail": "Wenn aktiviert, können Anrufer eine Nebenstelle direkt von der IVR anwählen. Sie können auswählen, dass Anrufer alle Nebenstellen oder nur die Erlaubten Nebenstellen anwählen dürfen, oder dass sie alle Nebenstellen mit Ausnahme der Eingeschränkten Nebenstellen anwählen dürfen. Diese Funktion ist standardmäßig deaktiviert.  ",
  "call_features.ivr.dial_outb_route_list": "Ausgehende Leitungen anwählen",
  "call_features.ivr.digit_timeout": "Zeitüberschreitung Zahl (s)",
  "call_features.ivr.digit_timeout_detail": "Bitte geben Sie die maximale Zeitüberschreitung (in Sekunden) zwischen den Zahlen für die Eingabe des Anrufers in die IVR an. Bei Zeitüberschreitung löst die IVR das entsprechende Ereignis entsprechend der Eingabe des Anrufers aus. Der Standard ist 3 s. ",
  "call_features.ivr.disable": "Deaktivieren",
  "call_features.ivr.enb_dial_check_vm": "Voicemail-Fernabfrage",
  "call_features.ivr.enb_dial_check_vm_detail": "Wenn aktiviert, können Anrufer Funktionscode + Nebenstellennummer wählen, um die Voicemail abzuhören. Der Standardfunktionscode ist *2. Diese Funktion ist standardmäßig aktiviert.",
  "call_features.ivr.enb_dial_check_vm_popup": "Für eine bessere Systemsicherheit ändern Sie bitte das Voicemail-Passwort der Nebenstellen, wenn „Voicemail-Fernabfage“ aktiviert ist. ",
  "call_features.ivr.enb_dial_check_vm_tip": "Um die Sicherheit zu verbessern, wenn Sie Wählen, um die Voicemail abzuhören aktiviert haben, ändern Sie bitte den PIN für den Zugriff auf die Voicemail Ihrer Nebenstellen.",
  "call_features.ivr.enb_dial_outb_routes": "Ausgehende Leitungen anwählen",
  "call_features.ivr.enb_dial_outb_routes_detail": "Wenn aktiviert, können Anrufer in der IVR ausgehende Leitungen anwählen. Diese Funktion ist standardmäßig aktiviert.",
  "call_features.ivr.end_call": "Beenden",
  "call_features.ivr.extension": "Nebenstelle",
  "call_features.ivr.external_num": "Externe Nummer",
  "call_features.ivr.ext_vm": "Voicemail der Nebenstelle",
  "call_features.ivr.group_vm": "Voicemail an eine Gruppe",
  "call_features.ivr.invaild_dest": "Ungültige Eingabe Ziel",
  "call_features.ivr.invaild_dest_detail": "Dies definiert das auszulösende Ziel/Ereignis, wenn Anrufer eine DTMF-Zahl eingeben, die nicht für diese IVR definiert ist.",
  "call_features.ivr.ivr": "IVR",
  "call_features.ivr.key_press_event": "Ereignis Taste drücken",
  "call_features.ivr.name": "Name",
  "call_features.ivr.name_exist": "Der Name, den Sie für die IVR eingegeben haben, wurde bereits verwendet. Bitte versuchen Sie es mit einem anderen.",
  "call_features.ivr.number": "Nummer",
  "call_features.ivr.number_exist": "Die IVR-Nummer wurde bereits von {0} ({1}) verwendet. ",
  "call_features.ivr.play_greeting": "Ansage abspielen und verlassen",
  "call_features.ivr.press_dest": "Drücken",
  "call_features.ivr.prompt": "Ansage",
  "call_features.ivr.prompt_detail": "Bitte wählen Sie die Ansage aus, die automatisch abgespielt wird, wenn Anrufer die IVR erreichen. <br />Sie können bis zu 5 Ansagen auswählen. Das System spielt alle in ihrer Reihenfolge ab.",
  "call_features.ivr.prompt_repeat": "Zähler Wiederholung der Ansage",
  "call_features.ivr.prompt_repeat_detail": "Die maximale Anzahl, die die ausgewählten Ansagen abgespielt werden. Der Standard ist 3.",
  "call_features.ivr.queue": "Warteschlange",
  "call_features.ivr.resp_timeout": "Zeitüberschreitung Antwort (s)",
  "call_features.ivr.resp_timeout_detail": "Wählen Sie die maximale Anzahl an Sekunden aus, die nach dem Abspielen der Ansage auf eine DTMF-Zahleneingabe gewartet werden soll. Der Standard ist 3 s.\n\nWenn keine Eingabe empfangen wird, wiederholt das System die Ansage gemäß den Einstellungen des Zählers Wiederholung der Ansage, bis die Anzahl der Wiederholungen beendet hat.  Danach geht der Anruf zum Ziel bei Zeitüberschreitung, das für das Drücken einer Taste definiert ist.\n\n\n",
  "call_features.ivr.restrict": "Nur bestimmte Nebenstellen",
  "call_features.ivr.ring_group": "Anrufgruppe",
  "call_features.ivr.timeout_dest": "Zeitüberschreitung Antwort",
  "call_features.ivr.timeout_dest_detail": "Wenn es zu einer Zeitüberschreitung kommt, nachdem die IVR-Ansage so häufig abgespielt wurde, wie dies vom „Zähler Wiederholung der Ansage“ spezifiziert wurde, wird dies als Zeitüberschreitung der Antwort gewertet.",
  "call_features.queue.agents": "Agenten",
  "call_features.queue.agent_options": "Agentenoptionen",
  "call_features.queue.agent_prompt": "Agentenansage",
  "call_features.queue.agent_prompt_detail": "Die Ansage, die Agenten abgespielt wird, wenn Agenten einen Anruf aus der Warteschlange annehmen.",
  "call_features.queue.agent_timeout": "Zeitüberschreitung Agent (s)",
  "call_features.queue.agent_timeout_detail": "Bitte geben Sie die maximale Dauer (in Sekunden) an, während der die Warteschlange einen Agenten anruft, bevor sie zum nächsten verfügbaren Agenten wechselt. Der Standard ist 30 s.",
  "call_features.queue.announcement": "Ansage",
  "call_features.queue.announcement_pos": "Ansagen der Anruferposition",
  "call_features.queue.caller_announce_freq": "Frequenz (s)",
  "call_features.queue.caller_announce_freq_detail": "Die Frequenz, mit der die Ansage der Anruferposition regelmäßig abgespielt wird (in Sekunden). Der Standard ist 30 s. ",
  "call_features.queue.dynamic_agent_list": "Dynamische Agenten",
  "call_features.queue.dynamic_agent_list_detail": "Dynamische Agenten sind vorübergehende Agenten der Wartschlange, die sich in der Warteschlange anmelden müssen, um Anrufe aus der Warteschlange anzunehmen, nachdem sie zu Mitgliedern der Warteschlange ausgewählt wurden. Nachdem sie sich angemeldet haben, können dynamische Agenten den Empfang von Anrufen aus der Warteschlange unterbrechen oder fortsetzen und können sich aus der Warteschlange abmelden. ",
  "call_features.queue.enb_agent_call_conn": "Zulassen, um die Anrufe anderer Agenten anzunehmen oder zu beenden",
  "call_features.queue.enb_agent_call_conn_detail": "Wenn aktiviert, können Agenten die Anrufe anderer im Warteschlangenfenster im {OEM.LinkusName} Webclient annehmen oder beenden. Diese Funktion ist standardmäßig aktiviert.",
  "call_features.queue.enb_agent_call_dist": "Anrufverteilungsverwaltung (umleiten, weiterleiten, ziehen und ablegen)",
  "call_features.queue.enb_agent_call_dist_detail": "Wenn aktiviert, können Agenten Anrufe aus der Warteschlange im Warteschlangenfenster im {OEM.LinkusName} Webclient umleiten oder weiterleiten. Diese Funktion ist standardmäßig aktiviert.",
  "call_features.queue.enb_agent_call_park": "Vorgang Anrufparken",
  "call_features.queue.enb_agent_call_park_detail": "Wenn aktiviert, können Agenten Anrufe der Warteschlange im Warteschlangenfenster im {OEM.LinkusName} Webclient parken und abrufen. Diese Funktion ist standardmäßig aktiviert.",
  "call_features.queue.enb_announce_agent_id": "Ansage Agenten-ID",
  "call_features.queue.enb_announce_agent_id_detail": "Wenn aktiviert, wird den Anrufern eine Systemansage mit einer Agenten-ID abgespielt, wenn ihr Anruf von einem Agenten angenommen wird. Diese Funktion ist standardmäßig deaktiviert.",
  "call_features.queue.enb_announce_hold_time": "Ansage Zeit in der Warteschlange",
