  "extension_trunk.trunks.diversion_user_part": "Diversion",
  "extension_trunk.trunks.diversion_user_part_detail": "Definieren Sie den Wert im Diversion-Header dieses SIP-INVITE-Pakets für ausgehende Anrufe von diesem Trunk. Für die Konfiguration sind professionelle Kenntnisse über das SIP-Protokoll erforderlich, da inkorrekte Konfigurationen beim Anruf Probleme verursachen können. <br />\n<br />SIP-Register Trunk Einstellungsoptionen:\n<br /> [Standard]: Die Reihenfolge des Werts nach Priorität ist Ausgehende Leitung Ausgehende Anrufer-ID → Nebenstelle Ausgehende Anrufer-ID → Trunk Ausgehende Anrufer-ID → Trunk Teilnehmername → Nebenstelle Anrufer-ID → Die Anrufer-ID des Anrufers.\n<br />·[Keine]: Senden Sie diesen Parameter nicht mit SIP-INVITE-Paket.\n<br />·Ausgehende Leitung Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID wird konfiguriert unter <b>Anrufsteuerung > Ausgehende Leitung</b>.\n<br /> Nebenstelle Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID der Nebenstelle mit dem Trunk.\n<br />·Ausgehende Anrufer-ID des Trunks:  Die ausgehende Anrufer-ID wird konfiguriert unter <b> Nebenstelle/Trunk > Trunk > Ausgehende Anrufer-ID > Allgemein</b>.\n<br /> Trunk-Teilnehmername: Der Teilnehmername des Trunks wird konfiguriert unter <b>Nebenstelle/Trunk > Trunk > Authentifizierung</b>\n<br />·Nebenstelle Anrufer-ID: Die Anrufer-ID konfiguriert in <b> Nebenstelle/Trunk > Nebenstelle > Teilnehmer > Nebenstelleninformationen</b>, standardmäßig dieselbe wie die Nebenstellennummer. \n<br />·Anrufer-ID des Anrufers: Die Anrufer-ID des Anrufers (des ersten Anrufers, falls der Anruf weitergeleitet wird). Wenn der Anrufer eine externe Nummer ist, wird die externe Nummer genommen. Wenn der Anrufer eine Nebenstelle ist, ist die Reihenfolge nach Priorität die Nebenstelle Ausgehende Anrufer-ID → [Standard]. \n<br />·Benutzerdefiniert: Definieren Sie einen benutzerdefinierten Wert.<br />\n\n<br />Einstellungsoptionen für SIP-Peer-Trunk und SIP-Account-Trunk:\n<br /> [Standard]: Die Reihenfolge nach Priorität ist Ausgehende Leitung Ausgehende Anrufer-ID → Nebenstelle Ausgehende Anrufer-ID → Trunk Ausgehende Anrufer-ID → Nebenstelle Anrufer-ID → Die Anrufer-ID des Anrufers.\n<br />·[Keine]: Senden Sie diesen Parameter nicht mit SIP-INVITE-Paket.\n<br />·Ausgehende Leitung Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID wird konfiguriert unter <b>Anrufsteuerung > Ausgehende Leitung</b>.\n<br /> Nebenstelle Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID der Nebenstelle mit dem Trunk.\n<br />·Ausgehende Anrufer-ID des Trunks:  Die ausgehende Anrufer-ID wird konfiguriert unter <b> Nebenstelle/Trunk > Trunk > Ausgehende Anrufer-ID > Allgemein</b>.\n<br />·Nebenstelle Anrufer-ID: Die Anrufer-ID wird konfiguriert unter <b> Nebenstelle/Trunk > Nebenstelle > Teilnehmer > Nebenstelleninformationen</b>, standardmäßig dieselbe wie die Nebenstellennummer. \n<br />·Anrufer-ID des Anrufers: Die Anrufer-ID des Anrufers (des ersten Anrufers, falls der Anruf weitergeleitet wird). Wenn der Anrufer eine externe Nummer ist, wird die externe Nummer genommen. Wenn der Anrufer eine Nebenstelle ist, ist die Reihenfolge nach Priorität die Nebenstelle Ausgehende Anrufer-ID → [Standard]. \n<br />·Benutzerdefiniert: Definieren Sie einen benutzerdefinierten Wert.<br />",
