  "extension_trunk.trunks.from_disp_name_part": "Teil Absenderanzeigename",
  "extension_trunk.trunks.from_disp_name_part_detail": "Alle ausgehenden Anrufe dieses SIP-Trunks verwenden den Absenderanzeigenamen im Absender-Header des SIP-Invite-Pakets. <br /> [Standard]: Zeigen Sie den Namen der ausgehenden Anrufer-ID an, wenn er wirklich ausgehend ist;<br />·Anrufer-ID der Nebenstelle Name: Diese Anrufer-ID besteht aus der Kombination aus „Nachname“ und „Vorname“ entsprechend der „Voreinstellung des Namensanzeigeformats“;<br /> Standardmäßige ausgehende Anrufer-ID des Trunk: Die standardmäßige Ausgehende Anrufer-ID im Trunk;<br /> Ausgehende Anrufer-ID der Nebenstelle im Trunk: Die ausgehende Anrufer-ID konfiguriert für die Nebenstelle im Trunk;<br /> Anrufer-ID des Anrufers: Die Anrufer-ID des ersten Anrufers, falls der Anruf weitergeleitet wird, und die Anrufer-ID ist abhängig von [Standard], wenn ein direkter Anruf gemacht wird;<br /> Benutzerdefiniert: Der Wert des Administrators benutzerdefiniert konfiguriert.",
  "extension_trunk.trunks.from_host_part": "Teil Absender-Host",
  "extension_trunk.trunks.from_user_part": "Teil Absenderteilnehmer",
  "extension_trunk.trunks.from_user_part_detail": "Definieren Sie den Wert im Absender-Header des SIP-INVITE-Pakets für ausgehende Anrufe von diesem Trunk. Für die Konfiguration sind professionelle Kenntnisse über das SIP-Protokoll erforderlich, da inkorrekte Konfigurationen beim Anruf Probleme verursachen können. <br />\n<br />SIP-Register Trunk Einstellungsoptionen:\n<br /> [Standard]: Die Reihenfolge nach Priorität ist Ausgehende Leitung Ausgehende Anrufer-ID → Nebenstelle Ausgehende Anrufer-ID → Trunk Ausgehende Anrufer-ID → Trunk Teilnehmername → Nebenstelle Anrufer-ID → Die Anrufer-ID des Anrufers.\n<br />·Ausgehende Leitung Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID wird konfiguriert unter <b>Anrufsteuerung > Ausgehende Leitung</b>.\n<br /> Nebenstelle Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID der Nebenstelle mit dem Trunk.\n<br />·Ausgehende Anrufer-ID des Trunks:  Die ausgehende Anrufer-ID konfiguriert in <b>Nebenstelle/Trunk > Trunk > Ausgehende Anrufer-ID > Allgemein</b>.\n<br /> Trunk-Teilnehmername: Der Teilnehmername des Trunks wird konfiguriert unter <b>Nebenstelle/Trunk > Trunk > Teilnehmername</b>\n<br />·Nebenstelle Anrufer-ID: Die Anrufer-ID wird konfiguriert unter <b> Nebenstelle/Trunk > Nebenstelle > Teilnehmer > Nebenstelleninformationen</b>, standardmäßig dieselbe wie die Nebenstellennummer. \n<br />·Anrufer-ID des Anrufers: Die Anrufer-ID des Anrufers (des ersten Anrufers, falls der Anruf weitergeleitet wird). Wenn der Anrufer eine externe Nummer ist, wird die externe Nummer genommen. Wenn der Anrufer eine Nebenstelle ist, ist die Reihenfolge nach Priorität die Nebenstelle Ausgehende Anrufer-ID → [Standard]. \n<br />·Benutzerdefiniert: Definieren Sie einen benutzerdefinierten Wert.<br />\n\n<br />Einstellungsoptionen für SIP-Peer-Trunk und SIP-Account-Trunk:\n<br /> [Standard]: Die Reihenfolge nach Priorität ist Ausgehende Leitung Ausgehende Anrufer-ID → Nebenstelle Ausgehende Anrufer-ID → Trunk Ausgehende Anrufer-ID → Nebenstelle Anrufer-ID → Die Anrufer-ID des Anrufers.\n<br />·Ausgehende Leitung Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID wird konfiguriert unter <b>Anrufsteuerung > Ausgehende Leitung</b>.\n<br /> Nebenstelle Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID der Nebenstelle mit dem Trunk.\n<br />·Ausgehende Anrufer-ID des Trunks:  Die ausgehende Anrufer-ID konfiguriert in <b>Nebenstelle/Trunk > Trunk > Ausgehende Anrufer-ID > Allgemein</b>.\n<br />·Nebenstelle Anrufer-ID: Die Anrufer-ID wird konfiguriert unter <b>Nebenstelle/Trunk > Nebenstelle > Teilnehmer > Nebenstelleninformationen</b>, standardmäßig dieselbe wie die Nebenstellennummer. \n<br />·Anrufer-ID des Anrufers: Die Anrufer-ID des Anrufers (des ersten Anrufers, falls der Anruf weitergeleitet wird). Wenn der Anrufer eine externe Nummer ist, wird die externe Nummer genommen. Wenn der Anrufer eine Nebenstelle ist, ist die Reihenfolge nach Priorität die Nebenstelle Ausgehende Anrufer-ID → [Standard]. \n<br />·Benutzerdefiniert: Definieren Sie einen benutzerdefinierten Wert.<br />",
