  "extension_trunk.trunks.outbound_cid_start": "Ausgehende Anrufer-ID Startziffer",
  "extension_trunk.trunks.outbound_cid_type": "Methode erstellen",
  "extension_trunk.trunks.outbound_cid_type_detail": "Die Optionen sind:<br /> Gemeinsame Ausgehende Anrufer-ID: Weisen Sie einer festen ausgehenden Anrufer-ID eine oder mehrere Nebenstellen oder Nebenstellengruppen zu oder verwenden Sie die Wildcard {{.Ext}}, um die Nebenstellennummer mit der ausgehenden Anrufer-ID abzustimmen. Definieren Sie beispielsweise das Muster der ausgehenden Anrufer-ID als 592550{{.Ext}} und wählen Sie dazu die Nebenstellen 1000 und 9001, sodass bei ausgehenden Anrufen von diesem Trunk die ausgehende Anrufer-ID 5925501000 für Nebenstelle 1000 und 5925509001 für Nebenstelle 9001 ist.<br /> Ausgehende Anrufer-ID Bereich: Verbinden Sie aufeinanderfolgende ausgehende Anrufer-IDs·mit One-to-One-Korrespondenzen. Definieren Sie den Bereich der ausgehenden Anrufer-ID beispielsweise als 5925503001-5925503005 und den Nebenstellenbereich als 1011-1015, sodass bei ausgehenden Anrufen von diesem Trunk die ausgehende Anrufer-ID 5925503001 für Nebenstelle 1011, 5925503002 für Nebenstelle 1012 und so weiter ist.",
  "extension_trunk.trunks.outbound_parameters": "Ausgehende Parameter",
