  "extension_trunk.trunks.outrounter_outbcid": "Ausgehende Leitung Ausgehende Anrufer-ID",
  "extension_trunk.trunks.overlap_dial": "Überlappend anwählen",
  "extension_trunk.trunks.overlap_dial_detail": "Definieren Sie, ob das System diesen Switch mit überlappenden Zahlen anwählen kann oder nicht. Wenn Sie direkte Einwahl benötigen, aktivieren Sie diese Option. Diese Funktion ist standardmäßig deaktiviert.",
  "extension_trunk.trunks.pai": "P-Asserted-Identity",
  "extension_trunk.trunks.pai_user_part": "P-Asserted-Identity",
  "extension_trunk.trunks.pai_user_part_detail": "Definieren Sie den Wert im P-Asserted-Identity-Header des SIP-INVITE-Pakets für ausgehende Anrufe von diesem Trunk. Für die Konfiguration sind professionelle Kenntnisse über das SIP-Protokoll erforderlich, da inkorrekte Konfigurationen beim Anruf Probleme verursachen können. <br />\n<br />SIP-Register Trunk Einstellungsoptionen:\n<br /> [Standard]: Die Reihenfolge nach Priorität ist Ausgehende Leitung Ausgehende Anrufer-ID → Nebenstelle Ausgehende Anrufer-ID → Trunk Ausgehende Anrufer-ID → Trunk Teilenehmername → Nebenstelle Anrufer-ID → Die Anrufer-ID des Anrufers.\n<br />·[Keine]: Senden Sie diesen Parameter nicht mit SIP-INVITE-Paket.\n<br />·Ausgehende Leitung Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID wird konfiguriert unter <b>Anrufsteuerung > Ausgehende Leitung</b>.\n<br /> Nebenstelle Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID der Nebenstelle mit dem Trunk.\n<br />·Ausgehende Anrufer-ID des Trunks:  Die ausgehende Anrufer-ID konfiguriert in <b>Nebenstelle/Trunk > Trunk > Ausgehende Anrufer-ID > Allgemein</b>.\n<br /> Trunk-Teilnehmername: Der Teilnehmername des Trunks konfiguriert unter <b>Nebenstelle/Trunk > Trunk > Authentifizierung</b>\n<br />·Nebenstelle Anrufer-ID: Die Anrufer-ID konfiguriert unter <b>Nebenstelle/Trunk > Nebenstelle > Teilnehmer > Nebenstelleninformationen </b>, standardmäßig dieselbe wie die Nebenstellennummer. \n<br />·Anrufer-ID des Anrufers: Die Anrufer-ID des Anrufers (des ersten Anrufers, falls der Anruf weitergeleitet wird). Wenn der Anrufer eine externe Nummer ist, wird die externe Nummer genommen. Wenn der Anrufer eine Nebenstelle ist, ist die Reihenfolge nach Priorität die Nebenstelle Ausgehende Anrufer-ID → [Standard]. \n<br />·Benutzerdefiniert: Definieren Sie einen benutzerdefinierten Wert.<br />\n\n<br />Einstellungsoptionen für SIP-Peer-Trunk und SIP-Account-Trunk:\n<br /> [Standard]: Die Reihenfolge nach Priorität ist Ausgehende Leitung Ausgehende Anrufer-ID → Nebenstelle Ausgehende Anrufer-ID → Trunk Ausgehende Anrufer-ID → Nebenstelle Anrufer-ID → Die Anrufer-ID des Anrufers.\n<br />·[Keine]: Senden Sie diesen Parameter nicht mit SIP-INVITE-Paket.\n<br />·Ausgehende Leitung Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID wird konfiguriert unter <b>Anrufsteuerung > Ausgehende Leitung</b>.\n<br /> Nebenstelle Ausgehende Anrufer-ID: Die ausgehende Anrufer-ID der Nebenstelle mit dem Trunk.\n<br />·Ausgehende Anrufer-ID des Trunks:  Die ausgehende Anrufer-ID konfiguriert in <b>Nebenstelle/Trunk > Trunk > Ausgehende Anrufer-ID > Allgemein</b>.\n<br />·Nebenstelle Anrufer-ID: Die Anrufer-ID wird konfiguriert unter <b>Nebenstelle/Trunk > Nebenstelle > Teilnehmer > Nebenstelleninformationen</b>, standardmäßig dieselbe wie die Nebenstellennummer. \n<br />·Anrufer-ID des Anrufers: Die Anrufer-ID des Anrufers (des ersten Anrufers, falls der Anruf weitergeleitet wird). Wenn der Anrufer eine externe Nummer ist, wird die externe Nummer genommen. Wenn der Anrufer eine Nebenstelle ist, ist die Reihenfolge nach Priorität die Nebenstelle Ausgehende Anrufer-ID → [Standard]. \n<br />·Benutzerdefiniert: Definieren Sie einen benutzerdefinierten Wert.",
