  "extension_trunk.trunks.patterns": "Muster",
  "extension_trunk.trunks.patterns_detail": "Die eingehende Anrufer-ID, die dem Anpassungsmuster entspricht, wird so angepasst, dass Sie direkt das Anrufprotokoll auf Ihrem Telefon drücken können, um eine Nummer zurückzurufen.<br />Im Anpassungsmuster haben die folgenden Zeichen besondere Bedeutung:<br />X entspricht den Zahlen 0-9;<br />Z entspricht den Zahlen 1-9;\n<br />N entspricht den Zahlen 2- 9;<br />[12345-9] entspricht den Zahlen in der Klammer (in diesem Beispiel 1, 2, 3, 4, 5, 6, 7, 8, 9);<br />Wildcard &#34;.&#34; entspricht einer oder mehreren Zahlen. Z. B. &#34;9011.&#34; entspricht allen, die mit 9011 beginnen (ausgenommen 9011 selbst);<br />Wildcard &#34;!&#34; entspricht keiner oder mehr als einer Zahl. Z. B. &#34;9011!&#34; entspricht allen, die mit 9011 beginnen (einschließlich 9011 selbst).",
