  "plan.cc.content": "Ein technisch äußerst ausgereiftes Set an Funktionen für Call-Center, das eine schnellere Anrufauflösung und Call-Center-Überwachung, Berichterstattung und Verwaltung in Echtzeit fördert. Unterstützung eines anpassbaren Wallboard für die proaktive Überwachung von 16 entscheidenden Leistungskennzahlen, einem schalttafelartigen Warteschlangenfenster für die Überwachung & Kontrolle von Warteschlangenaktivitäten in Echtzeit, aufschlussreichen Call-Center-Berichten, SLA und mehr. ",
  "plan.cc.explain": "Sorgen Sie für eine schnellere Annahme von Anrufen und eine Call-Center-Überwachung, Berichterstattung und Verwaltung in Echtzeit mit fortschrittlichen Call-Center-Funktionen, unter anderem einem anpassbaren Wallboard, einem schaltanlagenartigen Warteschlangenfenster, fortschrittlichem SLA, Warteschlangenmanager & E-Mail-Benachrichtigungen in Echtzeit sowie 8 Typen erweiterter Call-Center-Berichte.",
