  "plan.lcs": "{OEM.RemoteAccessServiceName}",
  "plan.lcs.answer": "Erste Schritte mit der. {0}. Erfahren Sie, wie Sie Ihren benutzerdefinierten Domänennamen für den PBX-Remote-Webzugriff einrichten und Ihre globalen Teams in wenigen Minuten zusammenbringen!",
  "plan.lcs.answer.done": "2. Wählen Sie {OEM.RemoteAccessServiceName} in den {OEM.LinkusName} Serverkonfigurationseinstellungen aus, klicken Sie auf Speichern und das wars!",
  "plan.lcs.answer.path": "1. Gehen Sie zu Nebenstelle und Trunk > Nebenstelle > {OEM.LinkusName} Server",
  "plan.lcs.content": "Nutzen Sie die Möglichkeit, von überall zu arbeiten, und ultimative UC bereitgestellt von einem Cloud-Dienst, der mit Ihrem {OEM.Series} Gerät verbunden ist. {OEM.RemoteAccessServiceName} stellt ein vollständiges Spektrum an Nebenstellen & UC-Optionen auf {OEM.LinkusName} zur Verfügung - ortsunabhängig - und befreit Sie von einer riskanten Portweiterleitung mit einer ununterbrochenen, sicheren {OEM.LinkusName} Fernverbindung.",
  "plan.lcs.email": "Sie können auch eine {OEM.LinkusName} Willkommens-E-Mail schicken, sodass Ihre Teams schnell ihre {OEM.LinkusName} Clients anmelden. Siehe detailliertes {0}.",
  "plan.lcs.explain": "Aktivieren Sie {OEM.RemoteAccessServiceName} für eine ununterbrochene, sichere {OEM.LinkusName} Fernverbindung und erhalten Sie Zugriff auf ein volles Spektrum von Nebenstellenoptionen auf {OEM.LinkusName} Desktop & Mobile Clients von überall und sofort!",
  "plan.lcs.note": "<b>Note: </b>the PBX's {OEM.LinkusName} server is set up and connected automatically by the service now.",
  "plan.lcs.quality": "Bessere {OEM.LinkusName} Anrufqualität",
  "plan.lcs.question": "Wie können Sie den Dienst aktivieren?",
  "plan.lcs.setup": "Mühelose Einrichtung des {OEM.LinkusName} Servers",
  "plan.lcs.tunnel": "Privater und sicherer Tunnel",
  "plan.lcs.unuse": "{OEM.RemoteAccessServiceName} is a subscription-based service designed to set your team up for anywhere-anytime productivity, instantly and securely. It provides an easy-to-access domain name, safeguards PBX remote web access, and allows the remote workforce to enjoy consistent in-office unified communications experience with Linkus UC Clients anywhere, on any device.",
  "plan.lcs.unused": "{0}{OEM.RemoteAccessServiceName}{1} ist eine kostenpflichtige Funktion, die im Enterprise Plan enthalten ist. Sie ist für die Fernarbeit vorgesehen und befreit Sie von einer riskanten Port-Weiterleitung. Stattdessen bietet sie sichere Fernverbindungen und stellt Ihrem Team überall ein vollständiges Spektrum verschiedener Nebenstellenfunktionen auf {OEM.LinkusName} Desktop & Mobile Clients zur Verfügung. ",
  "plan.lcs.used": "Im Enterprise Plan enthalten ist {0}{OEM.RemoteAccessServiceName}{1} ein Dienst mit Mehrwert für die Fernarbeit. Er befreit Sie von einer riskanten Port-Weiterleitung. Stattdessen bietet er sichere Fernverbindungen und stellt Ihrem Team überall ein vollständiges Spektrum verschiedener Nebenstellenfunktionen auf {OEM.LinkusName} Desktop & Mobile Clients zur Verfügung.",
  "plan.lcs.used_fqdn": "Ihr Abonnement ist abgelaufen. Der {OEM.RemoteAccessServiceName}-Dienst wurde entwickelt, um Ihr Team für die Produktivität jederzeit und überall und sicher einzurichten. Es bietet einen leicht zugänglichen Domänennamen, schützt den Fernverwaltungs-Webzugriff und ermöglicht konsistente Unified Communications-Erlebnisse im Büro mit Linkus UC-Clients überall und auf jedem Gerät.",
  "plan.lcs.used_fqdnno": "Ihr Abonnement ist abgelaufen. Der {OEM.RemoteAccessServiceName}-Dienst wurde entwickelt, um Ihr Team für die Produktivität jederzeit und überall und sicher einzurichten. Es bietet einen leicht zugänglichen Domänennamen, schützt den Fernverwaltungs-Webzugriff und ermöglicht konsistente Unified Communications-Erlebnisse im Büro mit Linkus UC-Clients überall und auf jedem Gerät.\n\nUm den Dienst nutzen zu können, erneuern Sie bitte Ihr Abonnement und richten Sie Ihren benutzerdefinierten PBX-Domänennamen (FQDN) im <b>System > Netzwerk > öffentliche IP- und Ports</b>ein.",
  "plan.lcs.use_fqdn": "Der {OEM.RemoteAccessServiceName}-Dienst ist eine abonnementbasierte schlüsselfertige Remotearbeitslösung. Es bietet einen leicht zugänglichen Domänennamen, schützt den Fernsteuerungs-Remote-Webzugriff und ermöglicht es den Remote-Mitarbeitern, konsistente Unified Communications-Erfahrung im Büro mit Linkus UC zu genießen. Clients überall, auf jedem Gerät.",
  "plan.lcs.use_fqdnno": "{OEM.RemoteAccessServiceName}-Dienst ist eine abonnementbasierte schlüsselfertige Remote-Arbeitslösung, die einen leicht zugänglichen Domänennamen,\nschützt den PBX-Remote-Webzugriff und ermöglicht konsistente Unified Communications-Erlebnisse im Büro mit Linkus UC-Clients überall und auf jedem Gerät.<br /><b>Wichtig:</b>Richten Sie Ihren benutzerdefinierten PBX-Domänennamen (FQDN) im <b>System > Network > Public IP und Ports</b> ASAP ein. Nach der Konfiguration können sich Ihre Teams mit dem Domainnamen remote und sicher beim Linkus Web Client und PBX Management Portal der Nebenstellenanlage anmelden.",
  "plan.lcs.working": "Must-have für die Fernarbeit",
